import React from 'react';

export default function Navbar() {
	return (
		<div>
			<div class="min-h-screen md:flex">
				<div class="flex-none w-full md:max-w-xs bg-purple text-white">
					Sidebar
				</div>
				<div class="flex-1 bg-blue text-white">Main content area</div>
			</div>
		</div>
	);
}
